    "to_start_with_please_visit_the_binance_website": "1. Untuk memulai, silakan kunjungi situs web Binance: https://www.binance.com dan Masuk ke akun Binance Anda. <br/> <br/> 2. Setelah Anda masuk ke akun Anda, silakan klik 【Dompet】 - 【Deposit】 di sisi kanan atas halaman. <br/> <br/> 3. Masukkan singkatan atau nama lengkap koin / token yang ingin Anda setor atau pilih dari daftar. <br/> <br/> 4. Kami akan menggunakan BTC sebagai contoh. Untuk segera mendapatkan alamat setoran BTC untuk akun Anda, klik 【Salin Alamat Setoran BTC】, dan tempelkan ke bagian alamat platform yang sesuai, tempat Anda ingin menarik dana. Sebagai alternatif, Anda juga dapat mengklik 【Tampilkan kode QR】, dan menggunakan aplikasi seluler platform yang sesuai untuk memindai kode QR guna menyelesaikan setoran Anda ke Binance. Mohon diperhatikan: 【Deposit】 ke Binance adalah tindakan penarikan dari platform atau dompet yang sesuai. Jika Anda memilih untuk menyetor BTC ke Binance, pastikan Anda memilih untuk menarik BTC dari platform yang sesuai. Setoran non-BTC apa pun yang masuk ke alamat BTC Anda di Binance kemungkinan besar akan hilang dan tidak dapat diambil. mceclip3.png <br/> <br/> 5. Saat menyimpan beberapa token tertentu, Anda tidak hanya perlu memasukkan alamat setoran yang benar, tetapi juga mengisi bagian 【Tag】 yang mungkin diperlukan agar setoran Anda dikreditkan . (CATATAN: 【Tag】 juga dapat merujuk ke Memo atau ID Pembayaran) Harap pastikan bahwa 【Tag】 (jika perlu) dan alamat setoran sudah akurat dan diisi dengan benar agar setoran Anda ke Binance berhasil. Untuk mengonfirmasi bahwa Anda sepenuhnya menyadari perlunya kolom 【Tag】 dan alamat setoran yang akurat, centang kotak 【Saya mengerti bahwa setoran tanpa MEMO akan hilang】 dan klik 【Lanjutkan】 mceclip4.png <br/> <br/> 6. Kali ini kami akan menggunakan BNB sebagai contoh. Untuk mendapatkan alamat setoran BNB dan MEMO Anda dengan cepat, Anda dapat mengklik kedua tombol 【Salin MEMO】 dan 【Salin Alamat】, dan tempelkan ke platform terkait atau bagian MEMO dan alamat dompet yang ingin Anda tarik. Anda juga dapat mengklik 【Tampilkan kode QR】, dan menggunakan aplikasi seluler platform yang sesuai untuk memindai kode QR dan menyelesaikan setoran Anda ke akun Binance Anda.mceclip5.png <br/> <br/> 7. Setelah Anda berhasil menyetorkan dana ke Binance, Anda dapat kembali ke halaman utama Binance, arahkan kursor ke 【Dompet】 dan pilih 【Riwayat Setoran & Penarikan】 untuk melihat detail dan status setoran terakhir Anda. Anda dapat mengunjungi blockchain untuk memeriksa status dan detail lebih lanjut dari setiap transaksi setoran tertentu dengan mengklik hash di kolomTxID. mceclip6.png <br/> <br/> 8. Selain itu, Binance telah terintegrasi dengan platform berikut untuk memungkinkan pengguna kami membeli cryptocurrency dengan kartu kredit, kartu debit atau stablecoin: Simplex, TrustToken, dan Paxos. Jika Anda ingin membeli atau menjual cryptocurrency dan stablecoin langsung ke akun Binance Anda, klik tombol 【Beli / Jual Crypto】 - Anda juga akan menemukan detail selengkapnya tentang prosesnya di sana.",
